// src/pages/Home.js
import React, { useEffect, useState } from 'react';
import { getNews } from '../services/api';
import NewsList from '../components/NewsList';

const Home = () => {
    const [news, setNews] = useState([]);

    const fetchNews = async () => {
        const result = await getNews();
        setNews(result);
    };

    useEffect(() => {
        fetchNews();
    }, []);

    return (
        <div>
            <h1>Home</h1>
            <NewsList news={news} />
        </div>
    );
};

export default Home;
